INSERT INTO `jurisdicciones` VALUES ('1', 'J.S. 1 TUXTLA GUTIÉRREZ', 'Nos atiende el Dr. Axdir Rodrigo Padilla, Secretario Técnico, Lic. Juventino López Camacho, responsable de Insumos y Mario Trejo García. Jefe del Almacén ubicado en Santa María Riviera Col Choferes sn atrás de las gasolinera el Caballero', '8:00', '14:30', ' 1,200 m2 (estimado)', ' 10 personas (1 jefe de almacén, 1 auxiliar de archivo, 3 informáticos, 1 administrativo, 3 auxiliares y 1 chofer)', ' 1 vehículo de 3 ton.', ' 3 equipos de cómputo', 'SIAL', 'El almacén cuentan con mostrador para poder surtir caravanas o algún programa específico como VIH. Igual que los anteriores tienen un refrigerador, no pagan seguros, no cuentan con licencia sanitaria. Sólo una línea de racks al final.\r\nHay otro almacén a un lado separado solamente x una malla pero este lo maneja personal diferente , tienen allí activos fijos. habilitan tarimas para  crear una rampa de acceso.\r\n', 'SAVI', '299 claves', '188 claves', 'Marzo 2014', 'El responsable de atención médica de la JS recaba los requerimientos. Almacén base ello hace el pedido  al proveedor al final hacen el cuadro de distribución base existencias finales.\r\nPara tener el inventario tienen que imprimir el mismo de cada programa y sumarlo a mano.', ' De 2 a 3 meses', 'Cuentan sólo con un vehículo de 3 toneladas modelo 2004.\r\nNo tiene programa o calendario de distribución.\r\n', 'Las primeras dos autoridades de la Jurisdicción Sanitaria esperanzados con este posible cambio nos piden incluir en la propuesta:\r\n\r\n1. El insumo que entre al almacén cuyo origen y/o fuente de financiamiento está definido pierda identidad como tal para que se logre distribuir ya que hoy tienen de programas cuyos responsables piden no tocarlos y mucho de este insumo se acaba caducando.\r\n2. Apoyo para que SSCH pueda redefinir bien los Catálogos por tipo de Unidad, hoy no es del todo claro una vez que se definan los consumos reales\r\n', 'https://www.google.com/maps/embed?pb=!1m16!1m12!1m3!1d3820.2732508454264!2d-93.12312650000003!3d16.7630755!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!2m1!1sjurisdiccion+sanitaria+1+chiapas!5e0!3m2!1ses!2s!4v1397062367896'), ('2', 'J.S. 2 SAN CRISTÓBAL DE LAS CASAS', 'Quien nos recibe es el Jefe del Almacén  el señor Jesús Hernández Oseguera. ', '8:00', '14:30', '1,200 m2 (estimado)', '8 personas', ' 2 vehículos de 3 ton.', '3 equipos de cómputo', 'SIAL', 'El almacén  es rentado, amplio patio de maniobras pero tampoco con andenes de carga y/o descarga. Cuenta con 3 cortinas igual a 3 almacenes unidos. Uno lo usan para medicamento de sólidos, otro de líquidos y el tercero para material de curación. La red fría es a base de refrigeradores que no están conectados a ninguna planta de emergencia. No tiene Cofepris ni tampoco aseguran la mercancía en ningún momento, no tienen racks.\r\n', 'DISUR', '299 claves', '188 claves', 'Marzo 2014', 'El proveedor que surte tiene mayor de surtido entre un 80 al 85% de cada pedido, aunque las remisiones que presenta el proveedor lleva errores en los lotes. Cuando el proveedor recibe el pedido responden en 5 días naturales.\r\nEl responsable de atención médica de la JS recaba los requerimientos. Almacén base ello hace el pedido  al proveedor al final hacen el cuadro de distribución base existencias finales, los tiempos de respuesta del proveedor son rápidos y completas.\r\n', ' Bimestral', 'Cuentan con 2 vehículos de 3 toneladas.\r\nTiene un programa de distribución.\r\nDe las unidades que considera más conflictivas esta Balunaco, Tzunumil  y las Limas.\r\nDe las unidades no tripuladas y que son las de mayor consumo están los CESSA´s Aldama, Ell Pilar y los CSR Teopizca, Tenejapa y Chenaló. La principal falta de insumo actual es Albendazol y Sulfato Ferroso.\r\n', 'Lo interesante de esta visita es que el proveedor que les surte es evidente tiene mayor capacidad y a decir por el jefe de almacén surten del 80 al 85 % de cada pedido, más ordenado que otros proveedores aunque siempre las remisiones que presenta el proveedor lleva errores en los lotes.\r\n\r\nEn este caso 17 de los 18 Municipios que lo conforman están en el proyecto de Mesoamerica ', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3820.902653974105!2d-92.63704630000001!3d16.73170829999998!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x85ed453fbd7fa9d7%3A0x526451f26ca19230!2sAv+Insurgentes+24!5e0!3m2!1ses-419!2smx!4v1397074682940'), ('3', 'J.S. 3 COMITÁN', 'El jefe del almacén es Miguel Ángel Martínez Ortiz, 9631096481 también estuvo la CP Yaneth Martínez Domínguez.  El almacén esta ubicado en Periférico Oriente sn col. Chichima Acopetahua , sus dimensiones son de 21x40 m2', '8:00', '14:30', '840 m2 (estimado)', '15 personas', '2 vehículos de 3 ton.', '3 equipos de cómputo', 'SIAL', 'Ubican el insumo en piso, no cuentan con racks. \r\nNo tiene rampas de carga y descarga, tampoco Cofepris, ni contratan seguros de ninguna especie.', 'NADRO', '299 claves', '188 claves', 'Marzo 2014', 'El responsable de atención médica de la JS recaba los requerimientos. Almacén base ello hace el pedido  al proveedor al final hacen el cuadro de distribución base existencias finales. El proveedor ha surtido en promedio el 65 %. Las entregas las hacen mal, tienen que batallar mucho para ingresar el insumo al SIAL(Sistema de Información del Almacén) luego lo ubican en piso.\r\nDel piso hacen el picking del que reconocen hay errores de surtido.', 'Bimestral', 'Cuentan para la entrega con 2 vehículos de 3 toneladas.\r\nNo tienen capacidad para atender emergencias. Ya en la unidad termina su responsabilidad contra la entrega. Llegan a Centros de Salud y Casas de Salud. Los de Caravanas pasan por sus paquetes al almacén.', 'En este almacén también tienen el medicamento, material de curación y artículos diversos, la red fría son dos refrigeradores que no están conectados a ninguna plana de luz emergente. Algún insumo inclusive está en piso directo, sin estar al menos en tarimas.', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d957.5943823463853!2d-92.132778!3d16.252421!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x858d38b06286e3d7%3A0xe2d7e81e9c8aa35a!2s2a.+Sur+Oriente+(Prof.+Reynaldo+Avenda%C3%B1o)+25!5e0!3m2!1ses-419!2smx!4v1397071033345'), ('4', 'J.S. 4 VILLAFLORES', 'La J.S. 4 Villaflores se encuentra en la cabecera municipal Villaflores ubicada a 90 Km al sur de la ciudad de Tuxtla Gutiérrez con un tiempo estimado de recorrido de 1 hr 30 min. Para llegar a la J.S. se tiene que tomar la carretera federal No. 133 hacia Suchiapa hasta topar con la carretera federal No. 230 y dar vuelta hacia la izquierda. Al llegar a Villaflores lo más recomendable es tomar el libramiento y al pasar el río dar vuelta a la izquierda en la calle 5ta norte poniente y dar vuelta a la derecha en la 14a poniente sur. Las carreteras (133 y 230) se encuentra en algunos tramos en reparación por lo que se recomienda tener cuidado ya que hay grava suelta y desniveles en el pavimento.\r\n\r\nLa J.S. se encuentra ubicada en lo que anteriormente era el hospital general de Villaflores.\r\n\r\nNota: Hacer caso omiso al GPS de Google en el trayecto Suchiapa - Villaflores puesto que éste los guiará a través de un camino de terrecería que posteriormente se convierte en una brecha, el cual es más tardado y complicado a que si continúa uno por la carretera No. 133 hasta topar con la No. 230..\r\n', '8:00', '14:30', '60 m2 (estimado) + 2 cuartos de 6 m2 c/u', ' 5 personas (1 encargado de almacén, 2 administrativo, 2 choferes)', '1 vehículo de 1 ton.', '1 en funcionamiento', 'SIAL', 'El almacén de la J.S. se encuentra dentro de la misma ubicación y está habilitado en lo que anteriormente era el área de labor de parto. El encargado es Michel Armando Arce Estudico.\r\n\r\nLas condiciones no son las óptimas para el almacenaje de los insumos puesto que la temperatura es elevada y no hay circulación de aire. \r\n\r\nLa bodega principal cuenta con 2 aires acondicionados instalados pero ninguno de los 2 funciona.\r\n\r\nParte del insumo se encuentra en piso sin tarimas y no hay un control para las caducidades, ya que el sistema SIAL no emite las primeras caducidades como primeras salidas, más bien éstas se deben seleccionar manualmente.\r\n\r\nEl área de atención médica es quien les entrega las hojas de requerimiento para que realicen sus paquetes, mismos que realizan en bolsas negras de basura.\r\n\r\nEl personal de almacén es amable y está consciente de las condiciones en las que almacenan el insumo pero comenta que no se les proporcionan los recursos necesarios para cambiarse a un almacén con mejores condiciones y acondicionado para el correcto manejo de medicamentos.\r\n\r\nEl sistema SIAL no puede dar a conocer los totales de existencias en inventario de todas las partidas y/o claves. Únicamente puede arrojar los totales de los importes por partidas, por lo que hay que sumarizar manualmente las cantidades de cada partida y/o clave para conocer el total de existencias.\r\n\r\nAtienden actualmente 65 U.A. (18 Centros de salud + 45 casas de salud + 1 CESSA + 1 clínica de la mujer)\r\n', 'NADRO', '299 claves', '188 claves', 'Marzo 2014, surtió parcialidades del requerimiento, llegando a un 68% del primer pedido colocado el 30 de enero del 2014. Hasta la fecha se han colocado 4 pedidos a proveedor, ninguno de ellos se ha surtido al 100%. El proveedor les comenta que el desabasto se debe a que no tenían contrato firmado con SSCH hasta hace una semana.', 'El abasto está coordinado por el área de atención médica, cuya encargada es la enfermera Evelia Vazquez Lopez.\r\n\r\nCada U.A. lleva un control mediante paloteo de sus salidas, mismas que captura en un formato de requerimiento proporcionado por atención médica. Cada mes los médicos de las U.A. entregan el formato y el área de atención médica valida y captura en Excel las cantidades solicitadas en otro formato que entrega al almacén para la elaboración del paquete a entregar.\r\n\r\nEl área de atención médica realiza una solicitud mediante correo electrónico a NADRO y de acuerdo al requerimiento de las U.A. para 2 meses comparando contra las existencias que le proporciona el almacén de la J.S.\r\n\r\nNADRO entrega producto que en varias ocasiones tiene caducidad de 6 meses lo que complica a la J.S. poder desplazarlo con facilidad y que se caduque. Así también NADRO entrega en cajas de carton de huevo, aceite comestible u otros que no corresponden a productos farmacéuticos \r\n\r\nLas farmacias que tripula NADRO en la misma J.S. cuentan con un nivel de abasto del 88% (superior al que se maneja en el almacén de la J.S.). En éstas farmacias existe personal de la J.S. que valida las existencias y el nivel de abasto cada mes para verificar el cumplimiento del proveedor.\r\n\r\nCuando falta algún medicamento en el pedido que entrega el proveedor generalmente también falta en las farmacias que tripula. Actualmente hay desabasto de sulfato ferroso.\r\n\r\nNADRO entrega con remisiones y posteriormente cuando no hay devoluciones entrega la factura que ampara un cierto número de remisiones para poder cobrar el insumo entregado.\r\n\r\nHan tenido casos como con el Irbesartan que no correspondía la presentación que estaba entregando NADRO con la indicada en el catálogo. En todos los casos que se detectan o encuentran se devuelven al proveedor.', 'Bimestral', 'Cuentan sólo con un vehículo de 1 tonelada. Y en ocasiones les prestan una camioneta de la J.S. o se apoyan con los equipos zonales para los caminos difíciles ya que éstos cuentan con vehículos 4x4.\r\n\r\nTienen un programa de 10 rutas más no un calendario de distribución. Cada ruta contiene un promedio de 6 U.A.\r\n\r\nRealizan las entregas a las U.A. en un lapso de 20 días hábiles cada 2 meses.\r\n\r\nNo cuentan con personal suficiente para realizar la distribución por lo que ocupan parte del personal administrativo y de almacén para realizar dichas tareas.\r\n\r\nComentan que les hace falta apoyo para viáticos.\r\n\r\nLas U.A. de más difícil acceso son: Laguna del cofre (CSR), Emiliano Zapata Monte Cristo de Guerrero (CS), San Francisco (CS), Plan de la Libertad (CS), Tres Picos (CSR) y Tierra y Libertad (CS). De los cuales en temporada de lluvias se requiere 4x4 y para el único caso de San Francisco el acceso se dificulta tanto que se debe emplear avioneta.\r\n\r\nLas entregas a las U.A. se realizan mediante vale de salida del almacén aunado al formato de requerimiento del médico.\r\n\r\nAl 100% de las U.A. se les lleva el insumo hasta la unidad. Ninguno baja al almacén para surtirse salvo en el caso de que requieran un urgente.', 'El personal entrevistado nos atendió amablemente y se percibe voluntad para que se regularice la situación del abasto en la J.S.\r\nComentan que a su punto de vista la problemática es que no hay procesos y procedimientos estandarizados en las J.S. que puedan seguir para mejorar de manera interna y que ello complica todo el proceso.', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d957.6922814564423!2d-93.26686169999999!3d16.232304699999993!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x85933b5739f91a97%3A0x384cd0e9178e3ae0!2s1a.+Poniente+Sur!5e0!3m2!1ses-419!2smx!4v1397070130710'), ('5', 'J.S. 5 PICHUCALCO', 'Nos atendió el Dr. Samuel Silva - Secretario Técnico de la Jurisdicción, el Enf. José Luis Briones Mansilla - Responsable de abasto y el Jefe de Almacén el Sr. Luis Hernández Ruíz.\r\nPichucalco cuenta con 22 municipios y 107 unidades de atención.', '8:00', '14:30', ' 250 m2 (estimado)', ' 1 Jefe de almacén, 1 capturista y 3 auxiliares', 'Ninguno', ' 1 computadora funcionando y 1 descompuesta, una laptop (propiedad Del jefe de almacén) y una impresora', 'SIAL (Sistema de Almacenes) y Excel', 'Almacén rentado, son tres accesorias, no se cuenta con licencia sanitaria, ni de funcionamiento.\r\nNo tienen internet, ni telefóno, no cuenta con red fría, el Insumo está en tarima, ubicado por orden de clave y semaforizado, no tiene ventilación adecuada, no cuenta con herramientas de trabajo, no tiene andenes, altura insuficiente.', 'NADRO', ' CAUSES: 287 claves Catálogo personalizado: 133 cl', 'CAUSES: 188 claves Catálogo personalizado: 81 clav', 'Febrero 2014', 'Su proceso de abasto a sus unidades es de manera mensual, siempre y cuando tengan los recursos para abastecer, sin embargo, las unidades cuentan con un Fondo Fijo (Stock) de 3 meses para que no estén en desabasto.\r\nEl departamento de abasto es el encargado de realizar y determinar el  pedido de las unidades contemplando la diferencia de las existencias y el fondo fijo.\r\nEl pedido que se le hace al proveedor llega en por parcialidades, pidieron en Noviembre y hasta Febrero les fue cubierto pero no el 100%, ya presentaron su siguiente pedido y están en espera del arribo.', ' Mensual y/o Bimestral; depend', 'No cuentan con vehículos y personal suficiente por lo que algunas unidades acuden al almacén por sus insumos.\r\nEl 80% de las unidades tiene carreteras de terracería.\r\nLas unidades Constitución y El Guanal son las más lejanas con un tiempo de 6 horas.', 'Del aeropuerto de Tuxtla a Pichucalco son 212 Km  con un tiempo de 4 hrs. El camino es muy sinuoso, está en buenas condiciones la carretera, aunque los últimos 45 km para llegar existen baches, desgajamiento de un carril de la carretera y varias fallas geológicas.\r\n\r\nNo tiene conocimiento total del contrato con el proveedor NADRO, solo les proporcionaron parcialmente el contrato.', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d951.2455609565064!2d-93.11684318650782!3d17.508361028868688!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x0!2zMTfCsDMwJzMxLjUiTiA5M8KwMDcnMDAuNSJX!5e0!3m2!1ses-419!2smx!4v1397071539734'), ('6', 'J.S. 6 PALENQUE', 'Se tuvo la entrevista con el Jefe Jurisdiccional el Dr. Luis Alejandro Exzacarias', '8:00', '14:30', '1,750 m2', '1 Jefe de Almacén + 2 auxiliares', 'No cuentan con vehículos, son solicitados a Administrador Jurisdiccional de acuerdo a necesidades', '2 equipos de computo y 1 impresosa', 'SIAL y controles en Excel', '1) No se cuenta con licencia sanitaria,\r\n2) No cuenta con red fría,\r\n3) Insumo en piso y otro en pallets,\r\n4) No tiene ventilación adecuada,\r\n5) No cuenta con herramientas de trabajo,\r\n6) No tiene andenes,\r\n7) Altura insuficiente,\r\n8) Insumo revuelto y no esta separado por lote ni caducidad,\r\n9) Espacio insuficiente.\r\n', 'DISUR', '299 claves', '188 claves', ' Marzo 2014, surtió parcialidades del requerimiento, llegando a un 60%', 'Almacén realiza requerimiento a proveedor en base a sus faltantes vs requerimiento de Unidades de Atención y de manera parcial el proveedor abastece en tres o cuatro semanas,, completando el 60% abasto en base al requerimiento inicial en 4 entregas.\r\n\r\nAlmacén tiene mucha dificultad al recepcionar ya que no cuadra lo físico vs facturado (remisionado); como la descripción autorizada, lotes, fechas de caducidad o incluso hay faltantes.', 'Bimestral', 'Adicional al desabasto por parte del proveedor, la J.S. no cuenta con los recursos (vehículos y personal principalmente) para poder hacer llegar los insumos requeridos por las U.A. en tiempo y forma, por lo que sus visitas pueden ser aleatorias, es decir, no garantizan llevar el insumo al 100% de las Unidades de Atención, depende de la disponibilidad de recursos que tengan.', 'La Jurisdicción participa con el Banco Interamericano de Desarrollo, el cual revisa que cumplan con los indicadores y metas de abasto y presupuestales para otorgar presupuesto estatal. También otorgan capacitaciones de abasto de biológico, medicamento, material de curación y perinatal', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d237.81191568412734!2d-91.98728948323011!3d17.507959719936515!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x0!2zMTfCsDMwJzI4LjciTiA5McKwNTknMTQuNiJX!5e0!3m2!1ses-419!2smx!4v1397072122065'), ('7', 'J.S. 7 TAPACHULA', 'La J.S. 7 de Tapachula se encuentra en la cabecera municipal Tapachula ubicada a 370 Km al sur de la ciudad de Tuxtla Gutiérrez con un tiempo estimado de recorrido de 4 horas. Para llegar a la J.S. se tiene que tomar la carretera federal No. 190 hacia Ocozocoautla y posteriormente la autopista No. 190 hacia Arriaga. Al llegar a Arriaga hay que tomar la carretera federal No. 200 hacia la izquierda con dirección a Tapachula. Tapachula se encuentra a 250 Km de Arriaga, la J.S. se encuentra  sobre la calle 3ra Oriente norte No. 34, para llegar entrando por el libramiento hasta la 3era avenida Norte y doblar a la derecha en la calle 3ra Oriente. La carretera 190 se encuentra en reparación a la altura de Ocozocuautla por lo que se recomienda tener cuidado ya que hay tráfico lento. La autopista 190 y carretera 200 se encuentran en buen estado. El almacén de la J.S. se encuentra a 3 km de la J.S.', '8:00', '14:30', ' 1,000 m2 de almacén (estimados) ', ' 10 (3 administrativos + 5 almacén + 2 choferes) / 5 con contrato ', '2 en total: 1 Nissan Urvan funcionando + 1 Ford Pick Up descompuesta', '2 funcionales + 1 Laptop (propiedad del Jefe del Almacén) ', '3 en total; 1 (SIAL) para el control de existencias en el almacén + 1 en Excel p', 'Condiciones no óptimas para el manejo de insumo médico, \r\n\r\nSe visualiza humedad, insumos en piso y no todo en tarimas, no hay racks, no cuenta con ventilación suficiente ni altura para controlar humedad y temperatura que pueda dañar el producto,\r\n\r\nSe identifica producto caducado.', 'NADRO', '299 claves', '188 claves', 'Marzo 2014, de acuerdo a una solicitud para 3 meses de 312 mil piezas (272 mil piezas de medicamento + 40 mil de mat. curación), misma que el proveedor surtió en un 43%. ', 'El almacén realiza un concentrado de lo que requieren las U.A. y lo compara contra sus existencias para determinar la necesidad adicional que le solicita al proveedor. \r\n\r\nEl proveedor generalmente le surte en un lapso de 2 a 3 semanas después de recibido el pedido pero nunca completo. \r\n\r\nEl almacén surte los pedidos de las U.A. a lo largo de 2 meses.\r\n', 'Bimestral', 'El 50% de las unidades lo recogen en el almacén y el 50% se les lleva directamente.\r\n\r\nComentan que la J.S. no cuenta con los recursos (vehículos y personal principalmente) para poder hacer llegar los insumos requeridos por las U.A. en tiempo y forma. \r\n\r\nLos pedidos de las U.A. se surten dependiendo el programa (8 = 1er Nivel, Oportunidades, Seguro Popular, Coordinación de la Mujer, Salud Pública y Atención Médica, Planificación Familiar y Campaña). \r\n\r\nPara los requerimientos por parte de las U.A. se cuenta con 2 formatos (1 para C.S. y otro para Casas de Salud) ambos impresos pero hay casos en que los C.S. que generalmente los atienden médicos pasantes que cuentan con equipo de cómputo lo llenan de manera electrónica en Excel, mismo que cuenta con pestañas donde se capturan las salidas, entradas y producto negado por falta de existencias para que el archivo mediante fórmulas calcule la necesidad de la unidad.', 'El personal entrevistado fue muy amable y nos atendió de buena manera.\r\n\r\nEl jefe del almacén se percibe con amplio conocimiento y con iniciativas propias para resolver la situación en su almacén. Comenta que a su percepción el problema del des abasto es causado por dos factores el primero un factor económico o de recursos y el segundo un factor de infraestructura. Con lo anterior resuelto cree que puede ayudar a resolver que cuando menos el insumo que tiene en su almacén se entregue a tiempo a sus U.A.\r\n\r\nEn conjunto con el Tecnológico de Tapachula están desarrollando un sistema para poder controlar los insumos en las Farmacias y Centros de Salud, a fin de que los médicos puedan capturar sus recetas y conocer lo que hay en existencias, de tal forma que en el almacén puedan obtener la información necesaria (en tiempo y forma) para poder solicitar a su vez a proveedor.', 'https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3855.5417675545887!2d-92.259626!3d14.906880000000003!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x858e093371d2c92b%3A0x6ea33015e385a2fb!2sJurisdicci%C3%B3n+Sanitaria+N%C3%BAmero+7!5e0!3m2!1ses-419!2smx!4v1397064010010'), ('8', 'J.S. 8 TONALÁ', 'La J.S. 8 Tonalá se encuentra en la cabecera municipal Tonalá ubicada a 150 Km al sur de la ciudad de Tuxtla Gutiérrez con un tiempo estimado de recorrido de 1 hr 45 min. Para llegar a la J.S. se tiene que tomar la carretera federal No. 190 hacia Ocozocoautla y posteriormente la autopista No. 190 hacia Arriaga. Al llegar a Arriaga hay que tomar la carretera federal No. 200 hacia la izquierda con dirección a Tapachula. Tonalá se encuentra a 20 Km de Arriaga y la J.S. se encuentra frente al parque Esperanza sobre la calle Francisco I. Madero, para llegar entrando por la avenida principal (Av. Hidalgo) al llegar al parque Esperanza hay que rodearlo para poder tomar la calle Francisco I. Madero. La carretera 190 se encuentra en reparación a la altura de Ocozocuautla por lo que se recomienda tener cuidado ya que hay tráfico lento. La autopista 190 y carretera 200 se encuentran en buen estado.', '8:00', '15:00', '450 m2 (estimado); edificio de 3 pisos (150 m2 c/u)', '8 personas (1 responsable de almacén, 1 administrativo, 2 choferes)', '2 vehículo (1 de 1 Ton. + 1 de 3.5  ton.)', '2  en funcionamiento (1 con SIAL únicamente)', 'SIAL', 'El almacén de la J.S. se encuentra sobre la calle Francisco I. Madero a unos 2 Km de la J.S. hacia el sur. Es un edificio de 3 pisos que se ocupa como almacén.\r\n\r\nLas condiciones no son las óptimas para el almacenaje de los insumos puesto que la temperatura es elevada y no hay buena circulación de aire. Aunado a que se percibe un olor concentrado a agro-químicos y fertilizantes.\r\n\r\nNo hay un control para los lotes y las caducidades, ya que el sistema SIAL no emite las primeras caducidades como primeras salidas, más bien éstas se deben seleccionar manualmente.\r\n\r\nEl área de atención médica es quien les entrega las hojas de requerimiento para que realicen sus paquetes.\r\n\r\nEl personal de almacén es amable y está consciente de las condiciones en las que almacenan el insumo pero comenta que no se les proporcionan los recursos necesarios para cambiarse a un almacén con mejores condiciones y acondicionado para el correcto manejo de medicamentos.\r\n\r\nEl sistema SIAL no puede dar a conocer los totales de existencias en inventario de todas las partidas y/o claves. Únicamente puede arrojar los totales de los importes por partidas, por lo que hay que sumarizar manualmente las cantidades de cada partida y/o clave para conocer el total de existencias. Así también comentan que últimamente el sistema les ha duplicado movimientos de entradas y salidas por lo que a falta de Internet lo han tenido que llevar hasta Tuxtla a revisión pero los técnicos no han encontrado qué es lo que está fallando en el mismo.\r\n\r\nAtienden actualmente 53 U.A. (21 Centros de salud + 26 casas de salud + 4 U. Móviles + 2 clínicas de la mujer)\r\n', 'DISUR', '299 claves', '188 claves', ' Marzo 2014, surtió parcialidades del requerimiento, llegando a un 80% de abasto. El proveedor les comenta que el desabasto se debe a que no hay medicamentos en el estado para cubrir la demanda.', 'El abasto está coordinado por el área de atención médica, cuya encargada es la Dra. Norma Vazquez López.\r\n\r\nCada U.A. lleva un control mediante un formato de requerimiento proporcionado por atención médica. Cada mes los médicos de las U.A. entregan el formato y el área de atención médica valida las cantidades solicitadas en el mismo formato que entrega al almacén para la elaboración del paquete a entregar.\r\n\r\nEl área de atención médica realiza una solicitud mediante correo electrónico a DISUR cada martes y de acuerdo al requerimiento de las U.A. que realizaron en diciembre del 2013 sobre un consumo promedio anual y mensual determinado y comparando contra las existencias que le proporciona el almacén de la J.S.\r\n\r\nDISUR entrega producto todos los viernes y/o lunes.\r\n\r\nLas farmacias que tripula DISUR en la misma J.S. cuentan con un nivel de abasto del 60% (inferior al que se maneja en el almacén de la J.S.).\r\n\r\nCuando falta algún medicamento en el pedido que entrega el proveedor generalmente también falta en las farmacias que tripula. Actualmente hay desabasto de sulfato ferroso.\r\n\r\nDISUR entrega con remisiones y hasta la fecha no ha entregado ni una sola factura para cobrar los insumos entregados.\r\n\r\nHan tenido casos como las tiras reactivas que no correspondía la presentación que estaba entregando DISUR con la indicada en el catálogo. Principalmente por la marca ya que para las tiras se requieren glucómetros de cierta marca y las tiras entregadas por DISUR eran de otra marca que no podían funcionar con los glucómetros de las U.A.', 'Bimestral', 'Cuentan con dos vehículos (1 de 1 Ton.+ 1  de 3.5 Ton.)\r\n\r\nTienen un programa de 9 rutas más no un calendario de distribución. Cada ruta contiene un promedio de 3 U.A.\r\n\r\nRealizan las entregas a las U.A. en un lapso de 20 días hábiles cada 2 meses.\r\n\r\nNo cuentan con personal suficiente para realizar la distribución por lo que ocupan parte del personal administrativo y de almacén para realizar dichas tareas.\r\n\r\nComentan que cuentan con apoyo de viáticos únicamente para la zona de Pijijiapan.\r\n\r\nLas U.A. de más difícil acceso son en el municipio de Pijijiapan: El Vergel, El Rosario, San Antonio Mancomún y Agricola 20 de Noviembre (en el municipio de Arriaga).\r\n\r\nLas entregas a las U.A. se realizan mediante vale de salida del almacén aunado al formato de requerimiento del médico.\r\n\r\nAl 100% de las U.A. se les lleva el insumo hasta la unidad. Ninguno baja al almacén para surtirse salvo en el caso de que requieran un urgente.', 'El personal entrevistado fue muy amable y se percibe que está en la mejor disposición para ayudar a resolver la problemática del abasto en su J.S.', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3833.496765013931!2d-93.751902!3d16.091839!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x85949fdaeaa8b81f%3A0x985df4cce216158d!2sJurisdicci%C3%B3n+Sanitaria+No.+VIII%2C+Calle+Francisco+I.+Madero!5e0!3m2!1ses-419!2smx!4v1397067362353'), ('9', 'J.S. 9 OCOSINGO', 'Ocosingo cuenta con 4 municipios: Ocosingo, Chilón, Altamirano y Sitalá\r\nAutoridades Entrevistadas\r\nDr. Kristian Gabriel Utrera Fernández.- Jefe Jurisdiccional\r\nDra. Aracely Ruiz Ríos- Coordinadora Oportunidades\r\nDr. Roberto Juan Cruz Vázquez.- Secretario Técnico y Coordinador de Caravanas\r\nSr- Juan Carlos Ferrera Trejo.- Jefe del Almacén\r\nSr. Jesús Mauricio Vazquez.- Jefe de Transportes\r\n', '8:00', '16:00', '1,050 m2 de almacén (estimados) y 625 m2 de almacén secundario.', '8 (1 administrativos + 5 almacén + 2 choferes)', '2 camionetas 3 ½ toneladas', '1 equipo de computo e impresora.', 'SIAL', 'No cuentan con licencia Sanitaria. No hay rampas para carga o descarga, una sola entrada o salida. No hay ningún sistema de seguridad, buen espacio de maniobras. Manejan como red fría un refrigerador conectado a la planta de emergencia de la JS, el transporte de la red es a través de hieleras con gel y o hielos. No cuentan con montacargas, todas las maniobras las hacen a mano tanto descarga del insumo que les llega de Nadro y del acomodo. Resguardaran medicamento que lo tienen en piso en tarimas y próximamente en ?racks? ordenados por clave diferenciados en sólidos y líquidos.', 'NADRO', '299 claves', '188 claves', 'Marzo 2014', 'El Coordinador de Atención Médica de la JS envía requerimiento al almacén. Este revisa su ?stock? y piden faltantes al proveedor quien surte habitualmente el 40 al 60 % del requerimiento dos o tres semanas después. Muchas veces la empresa lleva insumo No solicitado o que no corresponde con la caducidad mínima de 6 meses.', ' 3 a 4 meses con niveles de ab', '3 a 4 meses con niveles de abasto en promedio del 50 al 60 %.\r\nExisten 4 unidades cuyo personal médico y 3 enfermeras solo pueden trasladarse por medio de avionetas. Cuando acuden quedan en los sitios 20 días y descansan 10 cuando la avioneta las vuelve a recoger. Igual pasa con el insumo médico la entrega de cada paquete se le hace al piloto de la avioneta quien hace la entrega en estas unidades recabando el respectivo acuse, en ocasiones acude personal de la SSCH para hacer la entrega directa. El nombre de estas unidades son: Amador Hernández, Benito Juárez Miramar, Candelaria y el Guanal, las 4 en el municipio de Ocosingo. El costo de la avioneta por viaje es de $ 10,000. A estas unidades las llaman Caravanas Aéreas.\r\n', 'La Jurisdicción es parte del Proyecto de Mesoamérica obliga a la propia Jurisdicción y a la Secretaria de Salud de Chiapas a mejorar sus procesos de Abasto y Servicio de Distribución y Control de Insumos Médicos', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d15269.389952139636!2d-92.08239600000005!3d16.908143000000003!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x0!2zMTbCsDU0JzI5LjMiTiA5MsKwMDQnNTYuNiJX!5e0!3m2!1ses-419!2smx!4v1397072578996'), ('10', 'J.S. 10 MOTOZINTLA', 'La J.S. 10 Motozintla se encuentra en la cabecera municipal de Motozintla ubicada a 300 Km al sureste de la ciudad de Tuxtla Gutiérrez con un tiempo estimado de recorrido de 4 horas. Para llegar a la J.S. se tiene que tomar la carretera federal No. 190 hacia Comitán . Al llegar a Comitán seguir hacia Frontera Compalapa, antes hay un poblado llamado Ciudad Cuauhtemoc donde hay que tomar la carretera federal No. 211 hacia la derecha con dirección a Motozintla. \r\n\r\nLa J.S. se encuentra sobre la calle 2a Norte No. 235, para llegar entrando por el periferico hay que dar vuelta a la derecha en la calle 4a Norte y en la 8a Poniente dar vuelta a la derecha y posteriormente a la izquierda en la calle 2a Norte. La carretera 190 se encuentra en buen estado y la carretera 211 también pero se recomienda tener cuidado por que hay muchos topes y curvas pronunciadas.', '8:00', '14:30', ' 250 m2 de almacén (estimados)', '5 (2 administrativos + 3 choferes)', '3 Chevrolet Colorado descompuestas ', '1 funcional ', 'Ninguno', 'El almacén se encuentra a escasos 2 km de la J.S., \r\n\r\nLas condiciones no son óptimas para el manejo de insumo médico, se encuentran insumos en piso y no todo en tarimas, no hay racks, no cuenta con ventilación suficiente ni altura para controlar humedad y temperatura que pueda dañar el producto.\r\n\r\nEl techo es de lámina y no cuenta con aislante térmico.\r\n', 'DISUR', '299 claves', '188 claves', 'Marzo 2014', 'El almacén realiza un concentrado de lo que requieren las U.A. y lo compara contra sus existencias para determinar la necesidad adicional que le solicita al proveedor. Si el stock está por arriba de 3 meses no solicitan, sólo si la existencia se encuentra debajo del stock de 3 meses. \r\nEl proveedor generalmente le surte en un lapso de 2 a 3 semanas después de recibido el pedido pero nunca completo. \r\n\r\nEl insumo se tiene acomodado en orden de clave, pero no cuentan con ningún sistema para el control de lotes y caducidades. \r\n\r\nEl material de curación es colocado en la parte superior y el medicamento en la parte inferior. \r\n\r\nEl Dr. Iver comenta que recientemente tuvieron una reunión con el Secretario de Salud todas las J.S. donde se expuso la problemática que enfrenta cada una, en el caso de Motozintla con la infraestructura y personal.\r\n', 'Trimestral', 'La J.S. no cuenta con los recursos (vehículos y personal principalmente) para poder hacer llegar los insumos requeridos por las U.A. en tiempo y forma. \r\n\r\nLos pedidos de las U.A. no se surten por programa. \r\n\r\nLos requerimientos por parte de las U.A. se llevan con 2 formatos (1 para C.S. y otro para Casas de Salud) ambos impresos pero hay casos en que los C.S. que generalmente los atienden médicos pasantes que cuentan con equipo de cómputo lo llenan de manera electrónica. \r\n\r\nEl catálogo está reducido dependiendo del tipo de U.A. Los paquetes se entregan en bolsas negras de plástico. \r\n\r\nNo hay controles de lotes y caducidades.\r\n\r\nEl 100% de las unidades tienen que pasar por el insumo al almacén. \r\n', 'El personal que nos atendió fue amable y preocupados por la situación que en particular no cuentan con vehículos para abastecer las U.A.\r\n\r\n', 'https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3847.2105234914243!2d-92.2447706638725!3d15.365080726482363!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x858deceeb0f7ad47%3A0xaad52e7d7a74266c!2s2a.+Poniente+325!5e0!3m2!1ses-419!2smx!4v1397072705059');
COMMIT;

