--  Records of `tb_g`
-- ----------------------------
BEGIN;
INSERT INTO `tb_g` VALUES ('1001', 'Para el subdirector administrativo menciona que existen tres problemas que afectan el abasto: dinero, aplicación de normatividad (proceso licitatorio) e infraestructura.\r\n1. Dinero: Los presupuestos tiene un gran desface por año, ocasionando que la planeación de compra de insumos se vea afectada.\r\n2. Aplicación de normatividad: Menciona que en el caso del proceso licitatorio los tiempos son muy amplios afectando el abasto, así como el hecho de tener claves declaradas desiertas que al funal del día la unidad requiere y por necesidad tienen que realizar compras directas ocasionando un mayor gasto.\r\n3. Infraestructura: El hospital no cuenta con el espacio suficiente para almacenar los insumos, actualmente se almacena el medicamento en la farmacia de consulta externa, se acondicionaron tres tráiler como almacén, un cuarto anexo a la lavandería y se tiene las soluciones en un pasillo enfrente de un quirófano, en cuanto al material de curación cuenta con almacén en el cuarto de máquinas, un cuarto continua al almacén y si necesitan espacio ocupan parte del patio del cuarto de máquinas para almacenar.\r\nEl hospital tambien le da servicio a personas que tienen IMSS, ISSSTE e ISSSTECALI. \r\n '), ('1002', '* Hospital inaugurado en septiembre de 2011; originalmente contemplado para atender 200 partos al mes, actualmente son 900. El Hospital General ya no realiza partos. \r\n* Atienden principalmente a personas afiliadas al seguro popular, en caso de no estar afiliado se hace un estudio socio-económico para cobrarle acorde a sus posibilidades.\r\n* Se capturan las recetas en el sistema de almacenes y se lleva un registro en Excel (expediente electrónico pendiente de implementarse). \r\n* Estiman que 60-70% de sus insumos vienen del Almacén Estatal, el resto por compra directa.\r\n* El personal de farmacia y almacén va al almacén estatal a recoger insumo urgente.\r\n* Cuentan con 3 refrigeradores: controlados, farmacia y vacunas. El medicamento que se da en urgencia es para el momento, en caso de requerir más se tiene que asistir a consulta externa o a su centro de salud. Actualmente los controlados se entregan en caja completa o por unidosis, se está cambiando a que sea por caja completa. Existen algunos insumos médicos que manejan marca específica, esto por cuestiones de calidad, ej, sutura, sondas y algunos medicamentos.\r\n* Hacen inventario mensual.\r\n* Encargado de Recursos Materiales: Fernando Villegas Sánzhez, activoshmi@hotmail.com\r\n* Cuentan con 2 plantas de emergencia de 48 hrs de diesel.'), ('2001', 'El Hospital se encuentra en la denominada Zona Río de Tijuana, nos atendió la SubDirectora administrativa CP Ma Guadalupe Riesgo Quintana y la Lic. Brenda Acosta, Jefa de Recursos Materiales. Todo insumo llega al almacén y de éste se surte a farmacia interna, CEYE y Farmacia Consulta Externa; Farmacia Interna maneja controlados y medicamento y le surte a los servicios por requerimiento, CEYE le surte el material de curación a los servicios y farmacia de Consulta Externa medicamento a los Derechohabientes, no cuentan con Sistema Informático en la farmacia, ni en los consultorios, Almacén maneja el SIC, Sistema de Entradas y Salidas'), ('2002', 'Se llega por autopista de cuota a 75 kms de Tijuana. Nos atendió Subdirector Médico y posteriormente QFB Francisco Guerrero quien nos dio recorrido, y lo que más nos llamo la atención es que en la farmacia interna maneja unidosis manual, esta lo surte a pisos y a los cendis. En farmacia consulta externa llevan el control con un excel de las piezas que dispensan, sin embargo no cuentan con inventario, únicamente registran en almacén lo que les llega de manera mensual, almacén surte a farmacia consulta externa e interna y material de curación a pisos. Las instalaciones son adecuadas y nuevas.'), ('2003', 'Se llegó al Hospital sin problema con buena vialidad y calle pavimentada. Nos atendió Dr. Estolano Subdirector Médico, Lic. Isabel Rodríguez Comunicación Social del ISESALUD, QFB Alejandra Núñez, Juan Tomás Alvarado Jefe de Almacén, Isabel Maritza, encargada de Farmacia. Se cuenta con farmacia de Consulta Externa, Almacén y Farmacia Interna que administra a los pisos mediante unidosis manual (por cama). Se cuenta con un Sistema de Expediente Electrónico (SIGHO), éste no se encuentra actualizado, esto porque ya no existe el proveedor del Sistema, pero se encuentra funcionando, no se tiene la comunicación con el inventario de Farmacia, pero si realiza una receta al paciente, el cual lo lleva a farmacia para que se lo surtan, manifiesta el Dr. Estolano que si les facilta su tarea, pero que si se necesita desarrollar varios módulos que dejaron pendientes, tales como ver existencias desde la emisión de la receta, esto para eficientar el proceso de la dispensación y control de los insumos médicos. En su momento desea conocer nuestras bondades de nuestro Sistema SIALSS'), ('3001', 'La farmacia no cuenta con ningún tipo de orden de acomodo. No cuentan con sistema de semaforización del insumo. No cuentan con ubicaciones especificas para cada medicamento así como identificación del insumo que esta actualmente. La responsable de la farmacia tiene la licenciatura en Química y no Q.F.B. Para atender el horario de la farmacia el personal entra y sale a distintos horas. Según el rol de trabajo que se les asigne.\r\nEl área de urgencias, terapia intensiva y pediatría se encuentran en proceso de remodelación (ampliación de servicios).  \r\nEl Subdirector médico del turno vespertino entro a trabajar en el hospital el día lunes 21 de Abril de 2014 por lo que con apoyo de la supervisora y la jefa de enfermeras del turno vespertino, fueron las que nos proporcionaron los datos generales del hospital. \r\nEl almacén se utiliza también para guardar los consumibles del hospital (comedor y limpieza general). Se observa muy desordenado y con insuficiencia de espacio para almacenar todo el insumo. Se observó insumo sobre el piso, aún cunado se cuentan con tarimas (las cuales se tienen pero arrumbadas en otra parte). El almacén surte a los pisos lunes miércoles y viernes. Martes y jueves surte al CENDIS (Centro de Distribución), quien a su vez distribuye el insumo a los servicios (mini almacenes).\r\nLas áreas recorridas (Hospitalización y urgencias) se observan muy modernas, limpias y ordenadas.\r\nVarios de los servicios como: audiología y foniatría, geriatría, medicina física y rehabilitación, neumología y estomatología lo subrogan a otros lugares.\r\nEl área destinada para carga y descarga de insumo para el almacén es bastante amplia, más sin embargo el acceso al almacén esta reducido y complicado ocascionado por la falta de espacio del mismo.\r\nLos consultorios para la atención son los mismo para la consulta de primer y segundo nivel, no se cuenta con uno especifico para cada uno de los niveles. Se utiliza el que este disponible en el momento.');
COMMIT;

